Insert into BOOKS (ISBN,AVGCUSTOMERRATING,CATEGORY,NUMBEROFPAGES,NUMBEROFREVIEWS,PRICE,QUANTITY,RELEASEYEAR,SUMMARY,TITLE,IMAGEURL,SALES) values (1259589331,3.4,'Technology',1304,5,31.59,0,2017,'Fully updated for Java SE 9, Java: The Complete Reference, Tenth Edition explains how to develop, compile, debug, and run Java programs. Bestselling programming author Herb Schildt covers the entire Java language, including its syntax, keywords, and fundamental programming principles. You''ll also find information on key portions of the Java API library, such as I/O, the Collections Framework, the stream library, and the concurrency utilities. Swing, JavaFX, JavaBeans, and servlets are examined and numerous examples demonstrate Java in action. Of course, the new module system added by Java SE 9 is discussed in detail. This Oracle Press resource also offers an introduction to JShell, Java''s new interactive programming tool.','Java: The Complete Reference, Tenth Edition','https://images-na.ssl-images-amazon.com/images/I/51P0lRpq2TL._SX397_BO1,204,203,200_.jpg',1);
